script: |
  super -f text -I q5418.spq | sort > q5418.out

inputs:
  - name: q5418.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE + - col0 * col0 / - col1 NOT BETWEEN 78 * - - 67 / - col0 + 89 + + ( col1 ) AND col0;
  - name: tab0

outputs:
  - name: q5418.out
    data: |
      87	21	10
      97	1	99
